import React, { useState, useEffect } from 'react';

import "./Description.css";

import salaried from "../../Static/salaried.jpg";
import selfEmployed from "../../Static/self-employment-whitebg.jpg";
import student from "../../Static/student.jpg";
import freelancer from "../../Static/freelancer.jpg";

const Description = () => {
    const lines = [
        'I bring positivity wherever I go...',
        'I can take responsibilities for a task...',
        'I am batman...',
        'I am dead inside..',

        // Add more lines as needed
      ];

      const [currentLineIndex, setCurrentLineIndex] = useState(0);
      const [currentText, setCurrentText] = useState('');

      useEffect(() => {
        let lineIndex = 0;
        let textIndex = 0;

        const typeEffect = setInterval(() => {
          setCurrentText((prevText) => {
            const currentLine = lines[lineIndex];
            const updatedText = currentLine.substring(0, textIndex + 1);

            if (textIndex === currentLine.length) {
              // If the entire line is typed, move to the next line
              lineIndex = (lineIndex + 1) % lines.length;
              textIndex = 0;
            } else {
              textIndex += 1;
            }

            return updatedText;
          });
        }, 150); // Adjust the typing speed as needed

        return () => clearInterval(typeEffect);
      }, []);

    return(
        <div className='container text-center'>
            <div className='row justify-content-md-start'>
                <div class="mb-3">
                    <label for="exampleFormControlTextarea1" class="form-label">Tell us briefly about yourself</label>
                    <textarea class="form-control" id="exampleFormControlTextarea1" rows="3" placeholder='Introduce yourself...'></textarea>
                </div>
                <div class="mb-3">
                    <label for="exampleFormControlInput1" class="form-label">One characteristic which makes you special.</label>
                    <input type="email" class="form-control" id="exampleFormControlInput1" placeholder={currentText}/>
                </div>
            </div>
            <div>
                <label>Are you salaried, self-employed or a student?</label>
                <div className='row row-cols-lg-4 g-2 g-lg-3 description-row'>
                    <div className='col p-3'>
                        <div class="card description-card">
                            <img src={salaried} class="card-img-top description-card-img" alt="..."/>
                            <div class="card-body">
                                <p class="card-text">Salaried</p>
                            </div>
                        </div>
                    </div>
                    <div className='col p-3'>
                        <div class="card description-card">
                            <img src={selfEmployed} class="card-img-top description-card-img" alt="..."/>
                            <div class="card-body">
                                <p class="card-text">Self-employed</p>
                            </div>
                        </div>
                    </div>
                    <div className='col p-3'>
                        <div class="card description-card">
                            <img src={freelancer} class="card-img-top description-card-img" alt="..."/>
                            <div class="card-body">
                                <p class="card-text">Freelancer</p>
                            </div>
                        </div>
                    </div>
                    <div className='col p-3'>
                        <div class="card description-card">
                            <img src={student} class="card-img-top description-card-img" alt="..."/>
                            <div class="card-body">
                                <p class="card-text">Student</p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Description;
